export class RomulanNemesisUniformPack extends BaseRomulanUniformPack implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male",
                (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.RomulanNemesis)
                    + Uniform.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female",
                (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.RomulanNemesis)
                    + Uniform.averageFemaleBody, BodyType.AverageMale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformAndVariantBody(token: Token) {
        let result = "";
        let neck = this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.RomulanNemesis)
        switch (token.bodyType) {
            case BodyType.AverageMale:
                result = Uniform.averageMaleBody;
                break;
            case BodyType.AverageFemale:
            default:
                result = Uniform.averageFemaleBody;
        }

        return (neck + result).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getBorderLogo(token: Token): string {
        return borderSymbol;
    }
}